textOriginal:
Agora Imaginem se não tivessem essas imagens e pessoas conhecidas dele próximas da situação...aonde esse homem estaria?
1. Na casa dele como nada tivesse acontecido;
2. Teria passado cerca de 10 minutos no porta-malas de uma viatura;
3. Foi conduzido para uma delegacia mais próxima mais ainda não chegou;
4. Estaria por lá mesmo às "moscas"
5. Estaria sendo tratado como marginal e bandido.
